import React, { useEffect } from 'react';
import debounce from 'lodash.debounce';

const DemoPage = () => {
  useEffect(() => {
    const handleScroll = debounce(() => {
      const sections = document.querySelectorAll('.fadeIn');
      const scrollPosition = window.scrollY + window.innerHeight;

      sections.forEach((section, index) => {
        const isVisible = section.offsetTop < scrollPosition - 100;

        if (isVisible) {
          section.classList.add('opacity-100');
          section.classList.add(index % 2 === 0 ? 'animate-bottom-to-top' : 'animate-top-to-bottom');
        } else {
          section.classList.remove('opacity-100');
          section.classList.remove('animate-bottom-to-top', 'animate-top-to-bottom');
        }
      });
    }, 100);

    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <div className="bg-gray-900 text-white min-h-screen w-full">
      {/* Header Section */}
      <header className="relative py-40 text-center bg-gradient-to-r from-green-600 via-blue-500 to-indigo-700">
        {/* Background Gradient */}
        <div className="absolute top-0 left-0 w-full h-full bg-opacity-50 bg-gradient-to-r from-blue-800 to-indigo-800"></div>
        
        {/* Main Content */}
        <div className="relative z-10 text-white">
          <h1 className="text-6xl font-extrabold leading-tight tracking-wide">
            Welcome to <span className="text-transparent bg-clip-text bg-gradient-to-r from-green-400 to-blue-500">DBVision</span>
          </h1>
          <p className="text-lg text-gray-200 max-w-3xl mx-auto mt-6">
            Real-time database monitoring with interactive charts, dynamic insights, and automated performance tracking.
          </p>
        </div>
      </header>

      {/* Features Section */}
      <section className="py-16 px-6 sm:px-8 lg:px-12 space-y-12 bg-gray-800">
        <div className="fixed top-0 right-0 h-0 w-1 bg-green-500 z-50 scrollProgressLine transition-all duration-300"></div>

        {/* Feature Cards */}
        {[ 
          { title: "Interactive Dashboards", description: "Visualize your database with real-time, interactive charts that update as your data evolves.", icon: "📊" },
          { title: "Real-Time Data Monitoring", description: "Monitor your data with live updates for immediate insights into your database performance.", icon: "⏱️" },
          { title: "Comprehensive Analytics", description: "Access detailed analytics to track trends, queries, and database performance with ease.", icon: "📈" }
        ].map((feature, index) => (
          <div
            key={index}
            className="bg-gray-700 rounded-lg shadow-lg p-8 opacity-0 fadeIn transform transition-opacity duration-1000 animate__animated animate__fadeIn animate__delay-2s"
          >
            <div className="flex items-center mb-4">
              <div className="text-5xl mr-4 text-green-400">{feature.icon}</div>
              <h3 className="text-3xl font-semibold text-green-400">{feature.title}</h3>
            </div>
            <p className="text-gray-300 text-lg">{feature.description}</p>
          </div>
        ))}
      </section>

      {/* Monitoring Section */}
      <section className="py-16 px-6 sm:px-8 lg:px-12 space-y-12 bg-gradient-to-r from-blue-800 to-indigo-700">
        <h2 className="text-4xl font-semibold text-white text-center mb-6">
          Real-Time Monitoring for Your Database
        </h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {[ 
            { title: "Performance Analytics", icon: "📈", description: "Track your database's performance with up-to-date graphs showing key metrics." },
            { title: "Storage & Usage", icon: "💾", description: "Monitor storage usage with easy-to-read visualizations and stay aware of database capacity." },
            { title: "Query Insights", icon: "🔍", description: "Get insights into query performance and optimize your database operations." }
          ].map((item, index) => (
            <div
              key={index}
              className="bg-gray-800 p-6 rounded-lg shadow-lg opacity-0 fadeIn transform transition-opacity duration-1000 animate__animated animate__fadeIn animate__delay-3s"
            >
              <div className="text-4xl mb-4 text-green-400">{item.icon}</div>
              <h3 className="text-2xl font-semibold text-green-400 mb-2">{item.title}</h3>
              <p className="text-gray-300">{item.description}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Footer Section */}
      <footer className="py-6 text-center bg-gray-800">
        <p className="text-gray-400 text-sm">
          DBVision - All Rights Reserved | &copy; {new Date().getFullYear()}
        </p>
      </footer>
    </div>
  );
};

export default DemoPage;
